for (var i = 0; i < countries.length; i++) {
  L.circle([countries[i].lat, countries[i].lon], {
    fillOpacity: 0.75,
    color: "red",
    fillColor: "yellow",
    // Setting our circle's radius equal to the output of our markerSize function
    // This will make our marker's size proportionate to its population
    radius:markerSize(countries[i].value)
  }).bindPopup("<h1>" + countries[i].country + "</h1> <hr> <h3>Population: " + countries[i].value + "</h3>").addTo(myMap);
}

